import af2 from './images/test.png';
import {Switch, Route} from "react-router-dom";
import Parallax2 from './parallax2';
import Parallax3 from './components/parallax3';


function App() {


  return (
    <div className="App" >

        <Nav/>

        <Switch>
     <Route path="/about" component={Parallax2}/>
     <Route path="/" component={Parallax3}/>
     </Switch>



<Footer />
    </div>
  );
}

export default App;
